      <h3 className="m-0 pl-10 relative text-inherit font-normal font-inherit flex items-start shrink-0 max-w-full md:text-xl sm:text-lg">
        <span className="w-full">
          <span>Beyond the Classroom:</span>
          <br></br>
          <span className="text-white"> Your Social Study Space.</span>
        </span>
      </h3>
      <div className="w-[365px] px-5 flex flex-col items-center justify-center gap-[20px_0px] max-w-full text-white">
        <h3 className="m-0 relative text-inherit font-normal font-inherit inline-block max-w-full md:text-5xl sm:text-lg">
          Already have an account?
